import React from "react";
import FileUpload from "./components/FileUpload";
import "./App.css";
import logo from "./img/logo.svg";

//<img src={logo} alt='Font Frog Logo' width='100' />
const App = () => (
  <div className='container mt-4'>
    <h4 className='text-center mb-4 logo'>Font Frog</h4>
    <FileUpload />
  </div>
);

export default App;
